import React, { useState } from "react";
import "./App.css";
import Form from "./components/Form";
import MemberList from "./components/MemberList";

function App() {
  const [teamList, setTeamList] = useState([]);

  return (
    <div className="App">
      <Form />
      <MemberList />
    </div>
  );
}

export default App;
